import React from "react";
import { useNavigate } from "react-router-dom";

const Yarn = () => {
  const navigate = useNavigate(); 

  // Function to handle button click and navigate
  const handleNavigation = (path) => {
    navigate(path);
  };

  return (
    <div>
      <h2>Yarn Component</h2>
      {/* Four buttons with different paths */}
      <button onClick={() => handleNavigation("/path1")}>Go to Path 1</button>
      <button onClick={() => handleNavigation("/path2")}>Go to Path 2</button>
      <button onClick={() => handleNavigation("/path3")}>Go to Path 3</button>
      <button onClick={() => handleNavigation("/path4")}>Go to Path 4</button>
    </div>
  );
};

export default Yarn;
